import React from 'react'
import '../task2.css'
import { useHistory } from 'react-router-dom'

function NavBar() {
  const history = useHistory()
  function handleClick() {
    history.push('/')
  }
  return (
    <nav className="navbar">
      <img src="/images/trello2.png" onClick={handleClick}></img>
    </nav>
  )
}
export default NavBar
